import Vue from 'vue';
import App from './App.vue';
import router from './router';
import store from './store';
import './plugins';
import './modules';
import i18n from './lang';
Vue.config.productionTip = false;
var app = new Vue({
  router: router,
  i18n: i18n,
  store: store,
  render: function render(h) {
    return h(App);
  }
}).$mount('#app');
export default app;
